const express = require('express')
const dotenv = require('dotenv')
dotenv.config()
const mongoose = require('mongoose')
const routes = require('./routes')
const app = express()
const port = process.env.SERVER_URL || 3001

mongoose.connect(`mongodb+srv://tan9992015:${process.env.MONGO_DB}@cluster0.comarde.mongodb.net/?retryWrites=true&w=majority&appName=Cluster0`)
    .then(()=> {
        console.log("connect mongoose success")
    })
    .catch(err => {
        console.log(err)
    })

app.use(express.json())
app.use(express.urlencoded({extended: true}))

routes(app)

app.listen(port, ()=> {
    console.log( "server is running on port: " + port)
})

